import React, { Component } from "react";

class Teste extends Component {
  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://localhost:8080/test")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }));
  }
  componentWillMount() {
    this.callAPI();
}

  render() {
    return (
      <div>    

        <button onClick={()=> {

            console.log("clicked");

           document.getElementById('va').innerHTML= this.state.apiResponse}}>teste</button>
        <div id="va"></div>
      </div>
    );
  }
}

export default Teste;
